import React from "react";
import {Title} from './Title';
import styled, { css } from 'styled-components';
import {VantaggiNoleggio} from './vantaggi_noleggio';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
`;
const RedRectangle = styled.div`
    height: 264px;
    background: #8D120C;
    box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
    border-radius: 20px;
    position: relative;
`;
const RedTitle = styled.div`
    font-family: Poppins;
    font-style: normal;
    font-weight: bold;
    font-size: 48px;
    text-transform: uppercase;
    color: #FFFFFF;
    padding-top: 60px;
`;
const RedText = styled.div`
    font-family: Poppins;
    font-style: normal;
    font-weight: bold;
    font-size: 40px;
    text-transform: uppercase;
    color: #FFFFFF;
    padding-top: 40px;
`;
const Logo = styled.img`
    position: absolute;
    right: -1.5%;
    top: -35%;
`;
const BlackSquare = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    position: relative;
    height: 601px;
    background: #1D1D1B;
    border-radius: 20px;
    margin-top: 40px;
    margin-bottom: 24px;
`;
const BlackText = styled.div`
    font-weight: bold;
    font-size: 32px;
    line-height: 42px;
    text-transform: uppercase;
    color: #FFFFFF;
    position: relative;
    ${props => props.one && css`
        right: 145px;
        top: 80px;
    `}
    ${props => props.two && css`
        right: -20px;
        top: 160px;
    `}
    ${props => props.tree && css`
        right: 40px;
        top: 215px;
    `}
    ${props => props.four && css`
        top: 265px;
        left: 125px;
    `}
`;
const CreditCard = styled.img`
    position: absolute;
    left: -13%;
    top: -26%;
`;
const Like = styled.img`
    position: absolute;
    right: -10%;
    top: -23%;
`;
const CarVendo = styled.img`
    position: absolute;
    left: -10%;
    bottom: -18%;
`;
const Circle = styled.div`
    position: absolute;
    width: 100px;
    height: 100px;
    background: #8D120C;
    border-radius: 100px;
    ${props => props.one && css`
        left: 120px;
        bottom: 230px;
    `}
    ${props => props.two && css`
        right: 85px;
        top: 170px;
    `}
    ${props => props.tree && css`
        right: 85px;
        bottom: 85px;
    `}

`;
const RedArrow = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    width: 540px;
    height: 80px;
    background: #8D120C;
    border-radius: 38.5px;
`;

const TitleGuarda = styled.div`
    font-weight: bold;
    font-size: 34px;
    line-height: 41px;
    text-transform: uppercase;
    color: #FFFFFF;
    margin-top: 40px;
    margin-bottom: 24px;
`;
const RedArrowContainer = styled.div`
    position: relative;
    height: 80px;
`;
const BlackRectangle = styled.div`
    position: absolute;
    top: 0;
    left: -400px;
    background: #1D1D1B;
    width: 1230px;
    height: 446px;
    border-radius: 20px;
    z-index: 0;
`;
const Video = styled.iframe`
    text-align: right;
    position: relative;
    z-index: 1;
    border: none;
    outline: none;
    margin-top: 24px;
`;
const InfoTitle = styled.div`
    font-weight: bold;
    font-size: 20px;
    line-height: 24px;
    text-transform: uppercase;
    color: #FFFFFF;
    background: #1D1D1B;
    border-radius: 20px;
    margin-left: 50px;
    padding-top: 25px;
    padding-bottom: 25px;
`;
const InfoText = styled.div`
    font-weight: normal;
    font-size: 20px;
    color: #FFFFFF;
    text-align: left;
    padding-left: 10px;
`;
const SmallIcon = styled.img`
    width: 30px;
    height: 30px;
    padding-right: 10px;
`;
function Vendo_compro_auto() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto text-center"> 
        <img src="./images/mult_car.png"></img>
        <RedRectangle> 
            <Logo src="./images/logo4.svg"></Logo>
            <RedTitle>
                Perchè vendere la tua auto a noi?
            </RedTitle>
            <RedText>
                Perchè conviene!
            </RedText>
        </RedRectangle>       
        </Container>
        <div className="col-sm-8 mx-auto text-center">
            <BlackSquare>
                <CreditCard src="./images/credit_card.png"></CreditCard>
                <Like src="./images/like.png"></Like>
                <BlackText one>Pagamento immediato</BlackText>
                <BlackText two>Passaggio di proprieta immediato</BlackText>
                <BlackText tree>Valore quotazione dichiarata da<br></br> Quatroruote</BlackText>
                <BlackText four>Garanzia di sicurezza e<br></br> PROFESSIONALITÀ</BlackText>
                <CarVendo src="./images/car_vendo.png"></CarVendo>
                <Circle one></Circle>
                <Circle two></Circle>
                <Circle tree></Circle>
            </BlackSquare>
            <RedArrowContainer>
                <RedArrow></RedArrow>
            </RedArrowContainer>
        </div>
        <Container className="col-sm-8 mx-auto text-center row"> 
        <TitleGuarda className="mx-auto">guarda il video in modo da non dover leggere</TitleGuarda>

        <div className="col-sm-8">
        <BlackRectangle>
        </BlackRectangle>
        <Video width="700" height="400" src="https://www.youtube-nocookie.com/embed/n4SZbxnTkbk?controls=0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></Video>

        </div>
        <div className="col-sm-4">
            <InfoTitle>VENDITA & ACQUISTO AUTO www.tanteauto.it</InfoTitle>
            <InfoText>
            <div>Fabrizio Palpon</div>
            <div><SmallIcon src="/images/whatsapp.svg"></SmallIcon>393 989 39 09</div>
            <div><SmallIcon src="images/mail-red.png"></SmallIcon>fabrizio@tanteauto.it</div>
            <div><SmallIcon src="images/location.svg"></SmallIcon>via Montorfano 74/76 Seregno</div>
            </InfoText>
        </div>
        </Container>
        <VantaggiNoleggio/>
        </>
    );
}
export {Vendo_compro_auto};
